import { Link } from "react-router-dom";

function TeacherLogout({ setOpenModal }) {

    const myStyle={
        width: "500px",
        height: "50vh",
        textAlign: "center",
        marginLeft: "430px",
        marginTop: "150px"
    };
    const textStyle={
        fontSize: "60px"
    };
    const textStyle2={
        fontSize: "20px"
    };
    const myStyle2={
        marginLeft: "-200px" 
    }
    
   
    return (
        <>
        <div className="modal-background">    
        <div className="body" style={myStyle}> 
        <div className="titleCloseBtn" style={myStyle2}>
          <img id="closeImage" src={"https://icon-library.com/images/x-button-icon/x-button-icon-20.jpg"} alt=".." onClick={() => {setOpenModal(false);  }} width="30px" height="30px"/>
        </div>  

          <div className="title"> 
            <h1 style={textStyle}>Растау</h1>
            <br></br>
            <h6 style={textStyle2}>Аккаунттан шыққыңыз келе ме?</h6>
            <div>
                <Link to='/teacher-logout-yes'><button >Иә!</button></Link>
            </div>
          </div>       
        </div>       
    </div>
        
        </>
    );
}
export default TeacherLogout;
